    is: "Þessi rannsókn er ósamrýmanleg BBB vafranum (S) og einnig ósamrýmanleg OOO. Það þarf DDD með að minnsta kosti 222 CPU kjarna",
    id: "Studi ini tidak kompatibel dengan browser BBB dan juga tidak sesuai dengan OOO. Itu membutuhkan DDD dengan setidaknya 222 core CPU",
    ga: "Tá an staidéar seo neamh -chomhoiriúnach leis an mbrabhsálaí BBB agus leis an mbrabhsálaí BBB agus níl sé comhoiriúnach le OOO freisin. Teastaíonn DDD uaidh le 222 croí LAP ar a laghad",
    it: "Questo studio è incompatibile con il browser BBB e anche incompatibile con OOO. Ha bisogno di un DDD con almeno 222 core CPU",
    ja: "この研究は、BBBブラウザと互換性がなく、OOOとも互換性がありません。少なくとも222のCPUコアを持つDDDが必要です",
    jw: "Panaliten iki ora cocog karo browser BBB (s) lan uga ora kompatibel karo ooo. Perlu DDD paling ora 222 CPU CORE",
    kn: "ಈ ಅಧ್ಯಯನವು ಬಿಬಿಬಿ ಬ್ರೌಸರ್ (ಗಳು) ಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ ಮತ್ತು OOO ಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ. ಇದಕ್ಕೆ ಕನಿಷ್ಠ 222 ಸಿಪಿಯು ಕೋರ್ಗಳೊಂದಿಗೆ ಡಿಡಿಡಿ ಅಗತ್ಯವಿದೆ",
    kk: "Бұл зерттеу BBB браузеріне сәйкес келмейді, сонымен қатар OOO-мен үйлесімді емес. Оған кемінде 222 процессоры бар DDD қажет",
    ky: "Бул изилдөө BBB браузерине (лер) менен шайкеш келбейт, ошондой эле ОООга туура келбейт. Ага кеминде 222 CPU CORE менен DDD керек",
    ko: "이 연구는 BBB 브라우저와 호환되지 않으며 OOO와 호환되지 않습니다. 최소 222 CPU 코어가있는 DDD가 필요합니다.",
    lo: "ການສຶກສານີ້ບໍ່ເຂົ້າກັນກັບ BBB Browser ແລະຍັງບໍ່ເຫມາະສົມກັບ OOO. ມັນຕ້ອງການ DDD ທີ່ມີຢ່າງຫນ້ອຍ 222 CPU CORES",
    lv: "Šis pētījums nav savienojams ar BBB pārlūku (-iem) un arī nesaderīgs ar ooo. Tam ir nepieciešams DDD ar vismaz 222 CPU kodoliem",
    lt: "Šis tyrimas nesuderinamas su BBB naršykle (-omis) ir taip pat nesuderinamas su OOO. Tam reikia DDD su mažiausiai 222 procesoriaus šerdimis",
    mk: "Оваа студија е некомпатибилна со прелистувачот BBB (и) и исто така е некомпатибилна со OOO. Потребно е ДДД со најмалку 222 јадра на процесорот",
    mg: "Ity fandinihana ity dia tsy mifanaraka amin'ny bbb browser (s) ary tsy mifanaraka amin'ny OOO ihany koa. Mila ddd miaraka amin'ny CPU farafahakeliny 222",
    ms: "Kajian ini tidak serasi dengan pelayar BBB dan juga tidak serasi dengan OOO. Ia memerlukan DDD dengan sekurang -kurangnya 222 teras CPU",
    ml: "ഈ പഠനം ബിബിബി ബ്ര browser സർ (കൾ) പൊരുത്തപ്പെടുന്നില്ല, ഒപ്പം ooo- യുമായി പൊരുത്തപ്പെടുന്നില്ല. കുറഞ്ഞത് 222 സിപിയു കോറുകളുള്ള ഒരു ഡിഡിഡി ആവശ്യമാണ്",
    mt: "Dan l-istudju huwa inkompatibbli mal-browser (i) tal-BBB u wkoll inkompatibbli ma 'OOO. Jeħtieġ DDD b'mill-inqas 222 qlub tas-CPU",
    mr: "हा अभ्यास बीबीबी ब्राउझर (र्स) आणि ओओओशी विसंगत आहे. कमीतकमी 222 सीपीयू कोरसह डीडीडीची आवश्यकता आहे",
