    mn: "Энэхүү судалгаа нь BBB хөтөч (ууд) -тай нийцэхгүй бөгөөд ooo-тай нийцэхгүй байна. Энэ нь дор хаяж 222 CPU CPEA бүхий DDD хэрэгтэй",
    ne: "यो अध्ययन बीबीबी ब्राउजर (हरू) सँग अनगिल छ र ओओसँग पनि असंगत छ। यसलाई कम्तिमा 222 CPU कोरसँग DDD चाहिन्छ",
    no: "Denne studien er uforenlig med BBB -nettleseren (e) og også uforenlig med OOO. Den trenger en DDD med minst 222 CPU -kjerner",
    yi: "דער לערנען איז ינקאַמפּאַטאַבאַל מיט די BBB בלעטערער (s) און אויך ינקאַמפּאַטאַבאַל מיט אָאָאָ. עס דאַרף אַ DDD מיט לפּחות 222 קפּו קאָרעס",
