    sd: "اهو مطالعو بي بي بي براؤزر (سي بي بي براؤزر) سان مطابقت رکي ٿو ۽ پڻ او او او سان مطابقت رکي ٿو. انهي کي گهٽ ۾ گهٽ 222 سي پي يو ڪور سان ڊي ڊي ڊي جي ضرورت آهي",
    si: "මෙම අධ්යයනය BBBB බ්රව්සරය (ය) සමඟ නොගැලපෙන අතර OOO සමඟ නොගැලපේ. එය අවම වශයෙන් CPU නිවාස 222 ක් වත් ඩීඩීඩී එකක් අවශ්යයි",
