    ta: "இந்த ஆய்வு பிபிபி உலாவி (கள்) உடன் பொருந்தாது, மேலும் OOO உடன் பொருந்தாது. இதற்கு குறைந்தது 222 CPU கோர்களுடன் ஒரு டி.டி.டி தேவை",
