    ka: '❌ უკანონო პასუხი. მოდელის სახელი უნდა დაიწყოს "iPhone", ხოლო ფარული "A" ნომერი უნდა იყოს "A", რასაც მოჰყვება ოთხნიშნა რიცხვი.',
    de: '❌ Illegale Antwort. Der Modellname muss mit dem „iPhone“ beginnen, und die versteckte "Nummer" muss "a" sein, gefolgt von einer vierstelligen Nummer.',
    el: '❌ Παράνομη απάντηση. Το όνομα του μοντέλου πρέπει να ξεκινήσει το "iPhone" και ο κρυμμένος "αριθμός" Α "πρέπει να είναι" Α "ακολουθούμενος από τετραψήφιο αριθμό.',
    gu: '❌ ગેરકાયદેસર જવાબ. મોડેલનું નામ "આઇફોન" શરૂ કરવું આવશ્યક છે, અને છુપાયેલા "એ" નંબર "એ" હોવો જોઈએ, ત્યારબાદ ચાર-અંકનો નંબર આવે છે.',
    he: '❌ תשובה לא חוקית. על שם הדגם להתחיל "אייפון", והמספר "A" חייב להיות "A" ואחריו מספר בן ארבע ספרות.',
    hi: '❌ अवैध उत्तर। मॉडल का नाम "iPhone" शुरू करना होगा, और छिपा हुआ "एक" नंबर "A" होना चाहिए, इसके बाद चार अंकों की संख्या हो।',
    hu: '❌ Illegális válasz. A modellnévnek meg kell kezdenie az „iPhone” -t, és a rejtett "A" számnak pedig „A” -nak kell lennie, amelyet egy négyjegyű szám követ.',
    is: "❌ Ólöglegt svar. Nafn líkansins verður að byrja „iPhone“ og falinn „númer“ verður að vera „A“ og síðan fjögurra stafa tölu.",
