    ga: "❌ Freagra mídhleathach. Caithfidh an t-ainm samhla “iPhone” a thosú, agus ní mór go mbeadh an uimhir “a” i bhfolach “A” agus uimhir ceithre dhigit ina dhiaidh sin.",
    it: '❌ Risposta illegale. Il nome del modello deve iniziare "iPhone" e il numero "nascosto" deve essere "A" seguito da un numero di quattro cifre.',
    ja: '❌違法な答え。モデル名は「iPhone」を開始する必要があり、非表示の「 "number」は「a」に続く4桁の番号が必要です。',
    jw: '❌ Jawaban ilegal. Jeneng model kudu diwiwiti "iPhone", lan nomer sing didhelikake "kudu" a "diikuti nomer papat angka.',
    kn: '❌ ಕಾನೂನುಬಾಹಿರ ಉತ್ತರ. ಮಾದರಿ ಹೆಸರು “ಐಫೋನ್” ಅನ್ನು ಪ್ರಾರಂಭಿಸಬೇಕು, ಮತ್ತು ಗುಪ್ತ "ಎ" ಸಂಖ್ಯೆ "ಎ" ಆಗಿರಬೇಕು ಮತ್ತು ನಂತರ ನಾಲ್ಕು-ಅಂಕಿಯ ಸಂಖ್ಯೆ ಇರಬೇಕು.',
    kk: "❌ заңсыз жауап. Модель атауы «iPhone» басталуы керек және жасырын «A» нөмірі «A» болуы керек, содан кейін төрт таңбалы сан болуы керек.",
    ky: '❌ мыйзамсыз жооп. Моделдин аталышы "iPhone" башталышы керек жана жашыруун "A" номери "a" болушу керек, андан кийин төрт орундуу сан болушу керек.',
    ko: '❌ 불법적 인 답변. 모델 이름은 "iPhone"을 시작해야하며 숨겨진 "A"숫자는 "A"이어야합니다.',
    lo: '❌ຄໍາຕອບທີ່ຜິດກົດຫມາຍ. ຊື່ຕົວແບບຕ້ອງເລີ່ມຕົ້ນ "iPhone", ແລະເລກ "ທີ່ເຊື່ອງໄວ້" ຕ້ອງເປັນ "A" ຕິດຕາມດ້ວຍເລກສີ່ຕົວ.',
    lv: "❌ nelikumīga atbilde. Modeļa nosaukumam jāsāk “iPhone”, un slēptajam “skaitlim jābūt“ A ”, kam seko četrciparu skaitlis.",
    lt: "❌ Neteisėtas atsakymas. Modelio pavadinimas turi būti pradėtas „iPhone“, o paslėptas „A„ numeris turi būti „A“, po kurio eina keturių skaitmenų numeris.",
    mk: "❌ Нелегален одговор. Името на моделот мора да започне со „iPhone“, а скриениот „А“ број мора да биде „А“ проследено со четирицифрен број.",
