    ml: '❌ നിയമവിരുദ്ധ ഉത്തരം. മോഡൽ നാമം "iPhone" ആരംഭിക്കുകയും മറഞ്ഞിരിക്കുന്ന "എ" നമ്പർ "ഒരു" നമ്പർ "ഒരു" നാലക്കവും നാലക്കവും.',
    mt: '❌ Tweġiba illegali. L-isem tal-mudell għandu jibda "iPhone", u n-numru moħbi "għandu jkun" A "segwit minn numru b\'erba \'ċifri.',
    mr: '❌ बेकायदेशीर उत्तर. मॉडेलचे नाव “आयफोन” सुरू करणे आवश्यक आहे आणि लपविलेले "ए" नंबर "ए" असणे आवश्यक आहे त्यानंतर चार-अंकी क्रमांक.',
