    mn: '❌ Хууль бус хариулт. Загварын нэр нь "iPhone" -ийг "iPhone" эхлэх ёстой бөгөөд далд "A" дугаар нь "A" -ийг дөрвөн оронтой тоогоор дагах ёстой.',
    ne: '❌ अवैध उत्तर। मोडेल नामले "आईफोन" सुरु गर्नुपर्दछ, र लुकेका "ए" नम्बरको संख्या एक चार-अंक नम्बर पछि "A" हुनुपर्दछ।',
    no: '❌ Ulovlig svar. Modellnavnet må begynne "iPhone", og det skjulte "et" nummer må være "A" etterfulgt av et firesifret tall.',
    yi: '❌ ומלעגאַל ענטפֿערן. דער מאָדעל נאָמען מוזן אָנהייבן "יפאָנע", און די פאַרבאָרגן "אַ" נומער מוזן זיין "אַ" נאכגעגאנגען דורך אַ פיר-ציפֿער נומער.',
    fa: 'پاسخ غیرقانونی. نام مدل باید "آیفون" را آغاز کند ، و شماره پنهان "A" باید "A" باشد و به دنبال آن یک شماره چهار رقمی باشد.',
    pl: "❌ Nielegalna odpowiedź. Nazwa modelu musi rozpocząć „iPhone”, a ukryty numer „A” musi być „A”, a następnie czterocyfrowa liczba.",
    pt: '❌ Resposta ilegal. O nome do modelo deve começar "iPhone" e o número "A" oculto deve ser "A" seguido por um número de quatro dígitos.',
    pa: '❌ ਗੈਰਕਾਨੂੰਨੀ ਜਵਾਬ. ਮਾਡਲ ਨਾਮ ਲਾਜ਼ਮੀ ਤੌਰ \'ਤੇ "ਆਈਫੋਨ" ਅਤੇ ਲੁਕਿਆ ਹੋਇਆ "ਏ" ਨੰਬਰ ਲਾਜ਼ਮੀ ਤੌਰ\' ਤੇ ਇਕ ਚਾਰ-ਅੰਕ ਦਾ ਨੰਬਰ ਹੋਣਾ ਚਾਹੀਦਾ ਹੈ.',
    ro: "❌ Răspuns ilegal. Numele modelului trebuie să înceapă „iPhone”, iar numărul ascuns „A” trebuie să fie „A” urmat de un număr de patru cifre.",
    ru: "❌ Незаконный ответ. Имя модели должно начинаться «iPhone», а скрытый «номер» должен быть «А», за которым следует четырехзначный номер.",
    sm: '❌ NUCTS tali. O le faʻailoga igoa e tatau ona amata "iPhone", ma le nanaina "o le" numera e tatau ona "se" numera e fa.',
    sr: '❌ Нелегални одговор. Назив модела мора да започне "иПхоне", а скривени "А" број мора бити "а", а затим "А", а затим четвороцифрени број.',
    sd: '❌ غيرقانوني جواب. ماڊل جو نالو لازمي طور تي "آئي فون" شروع ڪرڻ گهرجي، ۽ لڪيل "هڪ" نمبر "هڪ" "هڪ" "هڪ" "هڪ" "هڪ" "هڪ" "" "" هڪ "" "هڪ" "هڪ" "" "" هڪ "" هڪ "" "هڪ" "" هڪ "" "هڪ" "هڪ" "" "" "" هڪ "" "" "" هڪ "',
    si: 'All නීති විරෝධී පිළිතුර. ආදර්ශ නාමයේ නම "අයිෆෝන්" ආරම්භ කළ යුතු අතර සැඟවුණු "ඒ" අංකයක් "ඒ" අංකයකින් පසුව ඉලක්කම් හතරක අංකයක් විය යුතුය.',
    sk: "❌ Nelegálna odpoveď. Názov modelu musí začať „iPhone“ a skryté „číslo“ musí byť „A“ nasledované štvorciferným číslom.",
    sl: '❌ Nezakonit odgovor. Ime modela se mora začeti "iPhone", skriti "A" pa mora biti "A", ki ji sledi štirimestna številka.',
    so: '❌ Jawaabta sharci darrada ah. Magaca Moodelka waa inuu ku bilowdaa "iPhone", oo qarsoon "oo" lambar "waa inuu noqdaa" a "waxaa ku xigay lambar afar-lambar ah.',
    es: '❌ Respuesta ilegal. El nombre del modelo debe comenzar "iPhone", y el número oculto "A" debe ser "A" seguido de un número de cuatro dígitos.',
    su: '❌ jawaban. Ngaran Modél kedah ngawitan "iPhone", sareng nomer anu disumputkeun "A" nomer "anu kedah" a "dituturkeun ku nomer opat angka.',
    sw: 'Jibu Jibu haramu. Jina la mfano lazima lianze "iPhone", na iliyofichwa "nambari" lazima iwe "A" ikifuatiwa na nambari ya nambari nne.',
    sv: '❌ Olagligt svar. Modellnamnet måste börja "iPhone", och det dolda "A" -nummeret måste vara "A" följt av ett fyrsiffrigt nummer.',
    tl: '❌ iligal na sagot. Ang pangalan ng modelo ay dapat magsimula ng "iPhone", at ang nakatagong "A" na numero ay dapat na "A" na sinusundan ng isang apat na digit na numero.',
    ta: '❌ சட்டவிரோத பதில். மாதிரி பெயர் “ஐபோன்” தொடங்க வேண்டும், மேலும் மறைக்கப்பட்ட "ஏ" எண் “ஏ” ஆக இருக்க வேண்டும், அதைத் தொடர்ந்து நான்கு இலக்க எண்ணும் இருக்க வேண்டும்.',
    te: 'Al చట్టవిరుద్ధమైన సమాధానం. మోడల్ పేరు తప్పనిసరిగా “ఐఫోన్” ను ప్రారంభించాలి, మరియు దాచిన "ఎ" నంబర్ తప్పనిసరిగా “ఎ” గా ఉండాలి, తరువాత నాలుగు అంకెల సంఖ్య ఉంటుంది.',
    th: '❌คำตอบที่ผิดกฎหมาย ชื่อรุ่นจะต้องเริ่มต้น“ iPhone” และหมายเลขที่ซ่อนอยู่ "A" หมายเลข "จะต้องเป็น" A "ตามด้วยตัวเลขสี่หลัก',
    tr: '❌ Yasadışı cevap. Model adı “iPhone” ı başlatmalı ve gizli "A" sayısı “A” ve ardından dört basamaklı bir sayı olmalıdır.',
    uk: '❌ Незаконна відповідь. Назва моделі повинна почати "iPhone", а прихований "номер" повинен бути "A", а потім чотиризначним номером.',
    ur: '❌ غیر قانونی جواب۔ ماڈل کا نام "آئی فون" شروع کرنا چاہئے ، اور چھپی ہوئی "A" نمبر "A" ہونا چاہئے جس کے بعد چار ہندسوں کا نمبر ہوگا۔',
    ug: "❌ قانۇنسىز جاۋاب. مودېل ئىسمى «iPhone» نى باشلىشى كېرەك, يوشۇرۇن «A» نىڭدا تۆت خانىلىق سان بولۇشى كېرەك.",
    uz: '❌ Noqonuniy javob. Model nomi "iPhone" va yashirin "A" ning to\'rt xonali raqami "a" bo\'lishi kerak.',
    vi: 'Câu trả lời bất hợp pháp. Tên mô hình phải bắt đầu từ iPhone iPhone, và số "A" ẩn phải là một số người theo sau là một số bốn chữ số.',
