    hr: '❌ Žao mi je, MMM NNN USB mikrofon, serijski SSS, još nije u biblioteci profila. Pritisnite nastavite da isprobate još jedan mikrofon. Ili pritisnite stranicu "Povratak na potrebe".',
    cs: "❌ Omlouvám se, mikrofon MMM NNN USB, sériový SSS, ještě není v knihovně profilu. Hit pokračujte vyzkoušejte jiný mikrofon. Nebo stiskněte „Return to Needs Needs Page“.",
    da: '❌ Undskyld, MMM NNN USB -mikrofon, seriel SSS, er endnu ikke i profilbiblioteket. Hit fortsæt med at prøve en anden mikrofon. Eller ramt "Return to Needs Page".',
    nl: 'Sorry, de MMM NNN USB -microfoon, seriële SSS, staat nog niet in de profielbibliotheek. Hit verder met het proberen van een andere microfoon. Of druk op "Return to Need Pagina".',
