    tl: "Higit pa sa 111 cm, mas mahirap maabot ang keyboard ng iyong computer, kaya huwag mag -atubiling gamitin ang keypad sa iyong smartphone.",
    ta: "111 செ.மீ தாண்டி, உங்கள் கணினியின் விசைப்பலகையை அடைவது கடினம், எனவே அதற்கு பதிலாக உங்கள் ஸ்மார்ட்போனில் விசைப்பலகையைப் பயன்படுத்தலாம்.",
    te: "111 సెం.మీ దాటి, మీ కంప్యూటర్ కీబోర్డ్‌ను చేరుకోవడం చాలా కష్టం, కాబట్టి బదులుగా మీ స్మార్ట్‌ఫోన్‌లో కీప్యాడ్‌ను ఉపయోగించడానికి సంకోచించకండి.",
    th: "เกิน 111 ซม. มันยากที่จะไปถึงแป้นพิมพ์คอมพิวเตอร์ของคุณดังนั้นอย่าลังเลที่จะใช้ปุ่มกดบนสมาร์ทโฟนของคุณแทน",
    tr: "111 cm'nin ötesinde, bilgisayarınızın klavyesine ulaşmak daha zordur, bu nedenle tuş takımını akıllı telefonunuzda kullanmaktan çekinmeyin.",
    uk: "Поза 111 см, важче дістатися до клавіатури вашого комп'ютера, тому сміливо використовуйте клавіатуру на своєму смартфоні.",
    ur: "111 سینٹی میٹر سے آگے ، آپ کے کمپیوٹر کے کی بورڈ تک پہنچنا مشکل ہے ، لہذا اس کے بجائے اپنے اسمارٹ فون پر کیپیڈ کو بلا جھجھک استعمال کریں۔",
    ug: "111 سانتىمېتىردىن ئېشىپ, كومپيۇتېرىڭىزنىڭ كۇنۇپكا تاختىسىغا يېتىش تەس, شۇڭا ئۇنىڭ ئورنىغا كۇنۇپكا تاختىسىنى ئىشلىتىپ بېقىڭ.",
    uz: "111 sm dan tashqarida kompyuteringizning klaviaturasiga etib borish qiyin, shuning uchun uning o'rniga smartfoningizda klaviaturani ishlatishingiz mumkin.",
