    gd: "Duilgheadas? Mura h-eil an astar gu math ceàrr, cliog an seo gus ath-chothromachadh, agus ath-thòiseachadh a 'bhloc seo.",
    ka: "პრობლემა? თუ მანძილი საშინლად არასწორია, დააჭირეთ აქ, რომ გადააკეთოთ იგი და გადატვირთოთ ეს ბლოკი.",
    de: "PROBLEM? Wenn die Entfernung furchtbar falsch erscheint, klicken Sie hier, um sie neu zu kalibrieren und diesen Block neu zu starten.",
