    gu: "સમસ્યા? જો અંતર ખૂબ જ ખોટું લાગે છે, તો તેને પુન al પ્રાપ્ત કરવા માટે અહીં ક્લિક કરો અને આ બ્લોકને ફરીથી પ્રારંભ કરો.",
    he: "בְּעָיָה? אם המרחק נראה שגוי להחריד, לחץ כאן כדי לכייל אותו מחדש ולהפעיל מחדש את החסימה הזו.",
    hi: "संकट? यदि दूरी बहुत गलत लगती है, तो इसे पुन: प्रस्तुत करने के लिए यहां क्लिक करें, और इस ब्लॉक को पुनरारंभ करें।",
    hu: "PROBLÉMA? Ha a távolság rettenetesen rossznak tűnik, kattintson ide az újrakalibráláshoz, és indítsa újra ezt a blokkot.",
    is: "Vandamál? Ef fjarlægðin virðist mjög röng, smelltu hér til að kvarða hana og endurræsa þessa reit.",
    id: "MASALAH? Jika jaraknya tampaknya sangat salah, klik di sini untuk mengkalibrasi ulang, dan memulai kembali blok ini.",
