    it: "PROBLEMA? Se la distanza sembra terribilmente sbagliata, fai clic qui per ricalibrare e riavvia questo blocco.",
    ja: "問題？距離がひどく間違っているように見える場合は、ここをクリックして再調整し、このブロックを再起動してください。",
    jw: "Masalah? Yen jarak kasebut salah banget, klik ing kene kanggo maca maneh, lan miwiti maneh blok iki.",
    kn: "ಸಮಸ್ಯೆ? ದೂರವು ಭಯಾನಕ ತಪ್ಪು ಎಂದು ತೋರುತ್ತಿದ್ದರೆ, ಅದನ್ನು ಮರುಸಂಗ್ರಹಿಸಲು ಇಲ್ಲಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಮತ್ತು ಈ ಬ್ಲಾಕ್ ಅನ್ನು ಮರುಪ್ರಾರಂಭಿಸಿ.",
    kk: "Мәселе? Егер қашықтық дұрыс болмаса, оны қайта тексеру үшін мына жерді нұқыңыз және осы блокты қайта бастаңыз.",
    ky: "Көйгөй? Эгер алыстык туура эмес сезилсе, аны кайра карап чыгуу үчүн бул жерди басуу үчүн бул блокту өчүрүп күйгүзүңүз.",
    ko: "문제? 거리가 끔찍한 것처럼 보이면 여기를 클릭하여 다시 교정 하고이 블록을 다시 시작하십시오.",
    lo: "ປັນຫາ? ຖ້າໄລຍະຫ່າງເບິ່ງຄືວ່າບໍ່ຖືກຕ້ອງ, ກົດບ່ອນນີ້ເພື່ອ recalibrate ມັນ, ແລະເລີ່ມຕົ້ນໃຫມ່ໃນທ່ອນໄມ້ນີ້.",
    lv: "Problēma? Ja attālums šķiet briesmīgi nepareizs, noklikšķiniet šeit, lai to pārkalibrētu, un restartējiet šo bloku.",
    lt: "Problema? Jei atstumas atrodo baisiai neteisingas, spustelėkite čia, kad jį iš naujo kalibruotumėte, ir paleiskite šį bloką iš naujo.",
    mk: "Проблем? Ако растојанието се чини многу погрешно, кликнете овде за да го преиспитате и да го рестартирате овој блок.",
    mg: "Olana? Raha diso ny elanelana, tsindrio eto raha hamerina hamerina azy io, ary avereno ity sakana ity.",
    ms: "Masalah? Jika jarak kelihatan sangat salah, klik di sini untuk mengkalibrasi semula, dan mulakan semula blok ini.",
    ml: "പ്രശ്നം? ദൂരം ഭയങ്കരമായി തെറ്റാണെന്ന് തോന്നുകയാണെങ്കിൽ, അത് വീണ്ടും വാങ്ങാനായി ഇവിടെ ക്ലിക്കുചെയ്യുക, ഈ ബ്ലോക്ക് പുനരാരംഭിക്കുക.",
    mt: "Problema? Jekk id-distanza tidher terriblement ħażina, ikklikkja hawn biex tikkalibraha mill-ġdid, u terġa 'tibda dan il-blokka.",
    mr: "समस्या? जर अंतर खूपच चुकीचे वाटत असेल तर ते पुन्हा तयार करण्यासाठी येथे क्लिक करा आणि हा ब्लॉक पुन्हा सुरू करा.",
