    mn: "Асуудал? Хэрэв зай нь үнэхээр буруу санагдаж байвал энд дарж, энэ блокыг дахин эхлүүлнэ үү.",
    ne: "समस्या हेर्नु? यदि दूरी ठूलो गलत देखिन्छ भने, यहाँ क्लिक गर्नुहोस् यसलाई पुन: लेख्न, र यो ब्लक पुन: सुरू गर्न।",
