    yi: "פּראָבלעם? אויב די ווייַטקייט מיינט טעראַבלי פאַלש, דריקט דאָ צו ריפאַליבראַטע עס, און ריסטאַרט דעם בלאָק.",
    fa: "مسئله؟ اگر فاصله به شدت اشتباه به نظر می رسد ، اینجا را کلیک کنید تا مجدداً آن را مجدداً مجدداً انجام دهید و این بلوک را مجدداً راه اندازی کنید.",
