    sd: "مسئلو؟ جيڪڏهن مفاصلو غلط لڳي ٿو، هتي ٻيهر حاصل ڪرڻ لاء هتي ڪلڪ ڪريو، ۽ هن بلاڪ کي ٻيهر شروع ڪيو.",
