    sv: "För en snabb kommunikationskontroll, peka på telefonens kamera på QR -koden nedan och tryck på länken som visas på telefonens skärm.",
    tl: "Para sa isang mabilis na tseke ng komunikasyon, ituro ang camera ng iyong telepono sa QR code sa ibaba at i -tap ang link na lilitaw sa screen ng iyong telepono.",
    ta: "விரைவான தகவல்தொடர்பு சோதனைக்கு, உங்கள் தொலைபேசியின் கேமராவை கீழே உள்ள QR குறியீட்டில் சுட்டிக்காட்டி, உங்கள் தொலைபேசியின் திரையில் தோன்றும் இணைப்பைத் தட்டவும்.",
    te: "శీఘ్ర కమ్యూనికేషన్ చెక్ కోసం, మీ ఫోన్ కెమెరాను దిగువ QR కోడ్ వద్ద సూచించండి మరియు మీ ఫోన్ స్క్రీన్‌లో కనిపించే లింక్‌ను నొక్కండి.",
    th: "สำหรับการตรวจสอบการสื่อสารอย่างรวดเร็วให้ชี้กล้องโทรศัพท์ของคุณที่รหัส QR ด้านล่างและแตะลิงค์ที่ปรากฏในหน้าจอโทรศัพท์ของคุณ",
    tr: "Hızlı bir iletişim kontrolü için, telefonunuzun kamerasını aşağıdaki QR koduna yönlendirin ve telefonunuzun ekranında görünen bağlantıya dokunun.",
    uk: "Для швидкої перевірки зв'язку вкажіть камеру телефону на QR -коді нижче та торкніться посилання, яке з’являється на екрані вашого телефону.",
    ur: "فوری مواصلات کی جانچ پڑتال کے لئے ، اپنے فون کے کیمرہ کو نیچے کیو آر کوڈ پر اشارہ کریں اور آپ کے فون کی اسکرین میں ظاہر ہونے والے لنک کو ٹیپ کریں۔",
    ug: "تېز ئالاقە تەكشۈرۈشى ئۈچۈن, تۆۋەندىكى QR كودىنى كىرگۈزۈڭ ۋە تېلېفونىڭىزنىڭ ئېكرانىدا كۆرۈنىدىغان ئۇلىنىشنى چېكىڭ.",
    uz: "Tez aloqa tekshiruvi uchun telefoningiz kamerasini quyida keltiring va telefoningiz ekranida paydo bo'lgan havolani bosing.",
