    hy: "Ընտրեք «Սմարթֆոնը», եթե օգտագործում եք ձեր սմարթֆոնի ներքին խոսափողը կամ դրա համար միացրեք արտաքին խոսափողը: Հակառակ դեպքում ընտրեք «USB»:",
    az: 'Smartfonunuzun daxili mikrofonundan istifadə etsəniz və ya xarici mikrofonu ona qoşsanız, "Smartphone" seçin. Əks təqdirdə "USB" seçin.',
    eu: 'Hautatu "Smartphone" zure telefonoaren barruko mikrofonoa erabiltzen baduzu edo kanpoko mikrofono bat konektatzen baduzu. Bestela, hautatu "USB".',
    bn: 'আপনি যদি আপনার স্মার্টফোনের অভ্যন্তরীণ মাইক্রোফোন ব্যবহার করেন বা এটির সাথে কোনও বাহ্যিক মাইক্রোফোন সংযুক্ত করেন তবে "স্মার্টফোন" নির্বাচন করুন। অন্যথায় "ইউএসবি" নির্বাচন করুন।',
    bg: 'Изберете "Смартфон", ако използвате вътрешния микрофон на вашия смартфон или свържете външен микрофон към него. В противен случай изберете "USB".',
    my: 'သင်၏စမတ်ဖုန်း၏အတွင်းပိုင်းမိုက်ကရိုဖုန်းကိုအသုံးပြုပါက "စမတ်ဖုန်း" ကိုရွေးပါ။ မဟုတ်ရင် "USB" ကိုရွေးပါ။',
    be: 'Выберыце "Смартфон", калі вы выкарыстоўваеце ўнутраны мікрафон вашага смартфона альбо падключыце да яго знешні мікрафон. У адваротным выпадку выберыце "USB".',
    km: 'ជ្រើសរើស "ស្មាតហ្វូន" ប្រសិនបើអ្នកប្រើមីក្រូហ្វូនខាងក្នុងរបស់ស្មាតហ្វូនរបស់អ្នកឬភ្ជាប់មីក្រូហ្វូនខាងក្រៅទៅវា។ បើមិនដូច្នេះទេជ្រើសរើស "យូអេសប៊ី" ។',
    ca: 'Seleccioneu "Smartphone" si utilitzeu el micròfon intern del vostre telèfon intel·ligent o connecteu -hi un micròfon extern. En cas contrari, seleccioneu "USB".',
