    gu: 'જો તમે તમારા સ્માર્ટફોનના આંતરિક માઇક્રોફોનનો ઉપયોગ કરો છો અથવા બાહ્ય માઇક્રોફોનને તેની સાથે કનેક્ટ કરો તો "સ્માર્ટફોન" પસંદ કરો. અન્યથા "યુએસબી" પસંદ કરો.',
    he: 'בחר "סמארטפון" אם אתה משתמש במיקרופון הפנימי של הטלפון החכם שלך או חבר אליו מיקרופון חיצוני. אחרת בחר "USB".',
    hi: 'यदि आप अपने स्मार्टफोन के आंतरिक माइक्रोफोन का उपयोग करते हैं या किसी बाहरी माइक्रोफोन को कनेक्ट करते हैं, तो "स्मार्टफोन" का चयन करें। अन्यथा "USB" का चयन करें।',
    hu: 'Válassza az "okostelefon" lehetőséget, ha az okostelefon belső mikrofont használja, vagy csatlakoztasson egy külső mikrofont. Ellenkező esetben válassza az "USB" lehetőséget.',
