    ar: "أدخل رقم الطراز واسم الهاتف (أو الميكروفون الخارجي المتصل بالهاتف) الذي تستخدمه في هذه المعايرة.",
    hy: "Մուտքագրեք հեռախոսի մոդելի համարը եւ անունը, որը միացված է հեռախոսին, որը դուք օգտագործում եք այս տրամաչափման համար:",
