    bg: "Въведете номера на модела и името на телефона (или външен микрофон, свързан към телефона), които използвате за това калибриране.",
    my: "ဤစံကိုက်ညှိမှုအတွက်သင်အသုံးပြုနေသောဖုန်း၏ဖုန်းနံပါတ်နှင့်အမည် (သို့မဟုတ်ပြင်ပမိုက်ခရိုဖုန်း) ကိုရိုက်ထည့်ပါ။",
    be: "Увядзіце нумар мадэлі і імя тэлефона (альбо знешняга мікрафона, падлучанага да тэлефона), які вы выкарыстоўваеце для гэтай каліброўкі.",
    km: "បញ្ចូលលេខម៉ូដែលនិងឈ្មោះទូរស័ព្ទ (ឬមីក្រូហ្វូនខាងក្រៅភ្ជាប់ទៅទូរស័ព្ទ) ដែលអ្នកកំពុងប្រើសម្រាប់ការក្រិតខ្នាតនេះ។",
