    gd: "Cuir a-steach àireamh modail agus ainm a 'fòn (no microfòn bhon taobh a-muigh ceangailte ris a' fòn) gu bheil thu a 'cleachdadh airson a' chalipration seo.",
    ka: "შეიყვანეთ ტელეფონის მოდელის ნომერი და სახელი (ან ტელეფონთან დაკავშირებული გარე მიკროფონი), რომელსაც იყენებთ ამ კალიბრაციისთვის.",
