    uz: "Endi karnay endi kalibrlangan. Ovoz balandligiga tegmang. Iltimos, ishlatgan mikrofonni olib qo'ying. Endi siz birma-bir mikrofonlarni kaltroflashingiz mumkin, bir vaqtning o'zida.",
    vi: "Loa hiện được hiệu chuẩn. Không chạm vào âm lượng. Vui lòng đặt bất cứ micrô nào bạn đã sử dụng. Bây giờ bạn có thể hiệu chỉnh micrô, mỗi lần một.",
