      "The microphone is now calibrated, and was added to the profile library. Please put it away. You can calibrate more microphones if you like.",
    "en-US_1":
      "The microphone is now calibrated, and was added to the profile library. Please put it away. You can calibrate more microphones if you like.",
    et: "Mikrofon on nüüd kalibreeritud ja lisatakse profiili teeki. Palun pange see minema. Kui soovite, saate rohkem mikrofone kalibreerida.",
