    ka: "მიკროფონი ახლა დაკალიბრებულია და დაემატა პროფილის ბიბლიოთეკაში. გთხოვთ, ჩამოაგდოთ. თქვენ შეგიძლიათ მეტი მიკროფონების დაკალიბრება, თუ გსურთ.",
    de: "Das Mikrofon ist jetzt kalibriert und wurde in die Profilbibliothek hinzugefügt. Bitte legen Sie es weg. Sie können mehr Mikrofone kalibrieren, wenn Sie möchten.",
