    gu: "માઇક્રોફોન હવે કેલિબ્રેટ થયેલ છે, અને પ્રોફાઇલ લાઇબ્રેરીમાં ઉમેરવામાં આવ્યો છે. કૃપા કરીને તેને દૂર કરો. જો તમને ગમે તો તમે વધુ માઇક્રોફોન કેલિબ્રેટ કરી શકો છો.",
    he: "המיקרופון מכויל כעת ונוסף לספריית הפרופיל. בבקשה תני אותו. אתה יכול לכייל יותר מיקרופונים אם תרצה.",
    hi: "माइक्रोफोन अब कैलिब्रेट किया गया है, और प्रोफ़ाइल लाइब्रेरी में जोड़ा गया था। कृपया इसे दूर रखें। यदि आप चाहें तो आप अधिक माइक्रोफोन को कैलिब्रेट कर सकते हैं।",
    hu: "A mikrofont most kalibráltuk, és hozzáadtuk a profilkönyvtárhoz. Kérem, tegye el. Ha úgy tetszik, kalibrálhat több mikrofont.",
    is: "Hljóðneminn er nú kvarðaður og var bætt við prófílbókasafnið. Vinsamlegast settu það í burtu. Þú getur kvarðað fleiri hljóðnema ef þú vilt.",
    id: "Mikrofon sekarang dikalibrasi, dan ditambahkan ke pustaka profil. Tolong simpan. Anda dapat mengkalibrasi lebih banyak mikrofon jika Anda suka.",
