    jw: "Mikropon saiki wis calibrated, lan ditambahake ing perpustakaan profil. Mangga lebokake. Sampeyan bisa luwih calibrate mikrofon liyane yen sampeyan seneng.",
    kn: "ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಈಗ ಮಾಪನಾಂಕ ಮಾಡಲಾಗಿದೆ, ಮತ್ತು ಇದನ್ನು ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಗೆ ಸೇರಿಸಲಾಗಿದೆ. ದಯವಿಟ್ಟು ಅದನ್ನು ದೂರವಿಡಿ. ನೀವು ಬಯಸಿದರೆ ನೀವು ಹೆಚ್ಚು ಮೈಕ್ರೊಫೋನ್ಗಳನ್ನು ಮಾಪನಾಂಕ ಮಾಡಬಹುದು.",
    kk: "Микрофон енді калибрленген және профиль кітапханасына қосылды. Өтінемін, оны қойыңыз. Қаласаңыз, көбірек микрофонды калибрлеуге болады.",
    ky: "Микрофон азыр калибрленген жана профиль китепканасына кошулду. Сураныч, аны коё бериңиз. Эгер сиз кааласаңыз, дагы бир микрофондорду калибрлей аласыз.",
    ko: "이제 마이크가 보정되어 프로파일 라이브러리에 추가되었습니다. 그것을 치워주세요. 원하는 경우 더 많은 마이크를 교정 할 수 있습니다.",
    lo: "ປັດຈຸບັນໄມໂຄຣໂຟນໄດ້ຖືກວັດແທກລົງ, ແລະໄດ້ຖືກເພີ່ມເຂົ້າໃນຫ້ອງສະຫມຸດໂປຼໄຟລ໌. ກະລຸນາເອົາມັນໄປ. ທ່ານສາມາດປັບລະບົບໄມໂຄຣໂຟນຫລາຍຂື້ນຖ້າທ່ານມັກ.",
    lv: "Mikrofons tagad ir kalibrēts un tika pievienots profila bibliotēkai. Lūdzu, novietojiet to prom. Ja vēlaties, varat kalibrēt vairāk mikrofonu.",
