    ms: "Mikrofon kini ditentukur, dan ditambah ke perpustakaan profil. Sila letakkannya. Anda boleh menentukur lebih banyak mikrofon jika anda suka.",
    ml: "മൈക്രോഫോൺ ഇപ്പോൾ കാലിബ്രേറ്റഡ് ആണ്, ഇത് പ്രൊഫൈൽ ലൈബ്രറിയിലേക്ക് ചേർത്തു. ദയവായി അത് മാറ്റി. നിങ്ങൾക്ക് ഇഷ്ടമാണെങ്കിൽ നിങ്ങൾക്ക് കൂടുതൽ മൈക്രോഫോണുകൾ കാലിബ്രേറ്റ് ചെയ്യാൻ കഴിയും.",
    mt: "Il-mikrofonu issa huwa kkalibrat, u ġie miżjud mal-librerija tal-profil. Jekk jogħġbok poġġiha. Tista 'tikkalibra aktar mikrofoni jekk tixtieq.",
