    ne: "माइक्रोफोन अब क्यालिब्रेट छ, र प्रोफाइल लाइब्रेरीमा थपिएको थियो। कृपया यसलाई टाढा राख्नुहोस्। तपाईं अधिक माइक्रोफोनहरू क्यालिब्रेट गर्न सक्नुहुनेछ यदि तपाईंलाई मनपर्यो भने।",
    no: "Mikrofonen er nå kalibrert, og ble lagt til profilbiblioteket. Vennligst legg den bort. Du kan kalibrere flere mikrofoner hvis du vil.",
    yi: "דער מיקראָפאָן איז איצט קאַלאַברייטיד און איז צוגעלייגט צו די פּראָפיל ביבליאָטעק. ביטע שטעלן עס אַוועק. איר קענען קאַלאַברייט מער מיקראָפאָן אויב איר ווילט.",
