    bg: 'Напредъкът се показва в основния прозорец на експеримента. Моля, отидете там сега, като щракнете върху раздела "Easyeyes Experiment" по -горе.',
    my: 'တိုးတက်မှုနှုန်းကိုအဓိကစမ်းသပ်မှု 0 င်းဒိုးတွင်ပြသသည်။ အထက်တွင် "EasyESES EACTATIENT" tab ကိုနှိပ်ခြင်းအားဖြင့်ယခုသွားပါ။',
