    mg: "Ity keypad ity dia alefa rehefa mihoatra ny 111 cm ny halaviran-kevitra tadiavina. Mandra-pahatongan'izany dia ampiasao ny fitendry ny solosainao.",
    ms: "Keypad ini akan didayakan apabila jarak tontonan yang dikehendaki melebihi 111 cm. Sehingga kemudian gunakan papan kekunci komputer anda.",
    ml: "111 സെന്റിമീറ്റർ കവിയുമ്പോൾ ഈ കീപാഡ് പ്രാപ്തമാക്കും. അതുവരെ നിങ്ങളുടെ കമ്പ്യൂട്ടറിന്റെ കീബോർഡ് ഉപയോഗിക്കുക.",
    mt: "Dan it-tastiera se tkun attivata meta d-distanza tal-vista mixtieqa taqbeż il-111 cm. Sa dakinhar uża t-tastiera tal-kompjuter tiegħek.",
    mr: "जेव्हा इच्छित दृश्य अंतर 111 सेमीपेक्षा जास्त असेल तेव्हा हे कीपॅड सक्षम केले जाईल. तोपर्यंत आपल्या संगणकाचा कीबोर्ड वापरा.",
