    mn: "Энэ товчлуур нь үзэх зай нь 111 см-ээс давсан тохиолдолд энэ товчлуурыг идэвхжүүлнэ. Дараа нь компьютерийн гараа ашиглана уу.",
    ne: "यो कुञ्जीपाद सक्षम हुनेछ जब इच्छित अवलोकन दूरी 111 सेन्टीमिटर भन्दा बढी हुन्छ। त्यसबेला सम्म तपाईंको कम्प्युटरको कुञ्जीपाटी प्रयोग नगर्नुहोस्।",
    no: "Dette tastaturet vil bli aktivert når ønsket visningsavstand overstiger 111 cm. Inntil da bruker datamaskinens tastatur.",
    yi: "דער קיפּאַד וועט זיין ענייבאַלד ווען דער געוואלט וויוינג ווייַטקייט יקסידז 111 סענטימעטער. ביז דאַן נוצן די קלאַוויאַטור פון דיין קאָמפּיוטער.",
    fa: "این صفحه کلید زمانی فعال می شود که فاصله مشاهده مورد نظر بیش از 111 سانتی متر باشد. تا آن زمان از صفحه کلید رایانه خود استفاده کنید.",
    pl: "Ta klawiatura zostanie włączona, gdy pożądana odległość oglądania przekroczy 111 cm. Do tego czasu użyj klawiatury komputera.",
    pt: "Este teclado será ativado quando a distância de visualização desejada exceder 111 cm. Até então, use o teclado do seu computador.",
    pa: "ਇਹ ਕੀਪੈਡ ਯੋਗ ਹੋਵੇਗਾ ਜਦੋਂ ਲੋੜੀਦੀ ਦੇਖਣ ਵਾਲੀ ਦੂਰੀ 111 ਸੈ.ਮੀ. ਉਦੋਂ ਤਕ ਆਪਣੇ ਕੰਪਿ computer ਟਰ ਦੇ ਕੀਬੋਰਡ ਦੀ ਵਰਤੋਂ ਕਰੋ.",
    ro: "Această tastatură va fi activată atunci când distanța dorită de vizualizare depășește 111 cm. Până atunci folosiți tastatura computerului.",
    ru: "Эта клавиатура будет включена, когда желаемое расстояние просмотра превышает 111 см. До тех пор используйте клавиатуру вашего компьютера.",
    sm: "O lenei keypad o le a mafai ona mafai pe a manaʻomia le fiafia i le sili atu 111 cm. Seia oʻo i le faʻaaogaina o lau komipiuta a lau komipiuta.",
    sr: "Ова тастатура ће бити омогућена када жељена удаљеност гледања прелази 111 цм. До тада користите тастатуру рачунара.",
    sd: "هي ڪيپ پيڊ کي فعال ڪيو ويندو جڏهن گهربل ڏسڻ وارو فاصلو 111 سينٽ کان وڌي ويندو. تيستائين پنهنجو ڪمپيوٽر جو ڪيبورڊ استعمال ڪريو.",
    si: "අපේක්ෂිත බැලීමේ දුර සෙන්ටිමීටර 111 ඉක්මවන විට මෙම යතුරු කබාඩ් සක්රීය කෙරේ. ඉන්පසු ඔබේ පරිගණකයේ යතුරුපුවරුව භාවිතා කරන තුරු.",
    sk: "Táto klávesnica bude povolená, keď požadovaná vzdialenosť sledovania prekročí 111 cm. Dovtedy použite klávesnicu počítača.",
    sl: "Ta tipkovnica bo omogočena, ko želena razdalja gledanja presega 111 cm. Do takrat uporabite tipkovnico računalnika.",
    so: "Keepad-kaan waa la qalcaa marka la doonayo in fogaanshaha la doonayo ay ka badan tahay 111 cm. Ilaa ka dib isticmaal keyboard kombiyuutarkaaga.",
