    sv: "Denna knappsats kommer att aktiveras när det önskade visningsavståndet överstiger 111 cm. Fram till dess använder du datorns tangentbord.",
    tl: "Ang keypad na ito ay paganahin kapag ang nais na distansya ng pagtingin ay lumampas sa 111 cm. Hanggang sa pagkatapos ay gamitin ang keyboard ng iyong computer.",
    ta: "விரும்பிய பார்வை தூரம் 111 செ.மீ தாண்டும்போது இந்த விசைப்பலகையை இயக்கும். அதுவரை உங்கள் கணினியின் விசைப்பலகையைப் பயன்படுத்தவும்.",
    te: "కావలసిన వీక్షణ దూరం 111 సెం.మీ మించి ఉన్నప్పుడు ఈ కీప్యాడ్ ప్రారంభించబడుతుంది. అప్పటి వరకు మీ కంప్యూటర్ కీబోర్డ్‌ను ఉపయోగించండి.",
    th: "ปุ่มกดนี้จะเปิดใช้งานเมื่อระยะการดูที่ต้องการเกิน 111 ซม. ก่อนหน้านั้นใช้แป้นพิมพ์คอมพิวเตอร์ของคุณ",
    tr: "Bu tuş takımı, istenen görüntüleme mesafesi 111 cm'yi aştığında etkinleştirilecektir. O zamana kadar bilgisayarınızın klavyesini kullanın.",
    uk: "Ця клавіатура буде включена, коли бажана відстань перегляду перевищує 111 см. До цього часу використовуйте клавіатуру комп'ютера.",
    ur: "جب مطلوبہ دیکھنے کا فاصلہ 111 سینٹی میٹر سے زیادہ ہو تو یہ کیپیڈ فعال ہوجائے گا۔ تب تک اپنے کمپیوٹر کا کی بورڈ استعمال کریں۔",
    ug: "لازىملىق كۆرۈش ئارىلىقى 111 سانتىمېتىردىن ئېشىپ كەتكەندە بۇ KeyPad قوزغىتىلىدۇ. ئاندىن كومپيۇتېرىڭىزنىڭ كۇنۇپكا تاختىسى ئىشلىتىڭ.",
    uz: "Ushbu klaviatura kerakli ko'rinishda ko'rish masofasi 111 sm dan oshganda ushbu klaviatura yoqiladi. O'sha paytgacha kompyuteringizning klaviaturasidan foydalaning.",
