    sl: "S klikom na prikaz na seznamu črk, pritisnite na tipkovnico ali pritisnite na tipkovnico.",
    so: "Adigoo gujinaya liiska liiska la soo bandhigay ee xarfaha, oo ku cadaadinaya furaha, ama ku cadaadinaya furaha.",
