    ta: "காட்டப்பட்ட எழுத்துக்களின் பட்டியலில் அதைக் கிளிக் செய்வதன் மூலம், விசைப்பலகையில் அழுத்துவதன் மூலம் அல்லது விசைப்பலகையில் அழுத்துவதன் மூலம்.",
