    "en-US_1":
      "Ready to identify the letters? While looking directly at the center of the cross hairs, please press the SPACE bar.",
    et: "Kas olete valmis tähed tuvastama? Vaadates otse risti karvade keskele, vajutage kosmoseriba.",
    fi: "Oletko valmis tunnistamaan kirjaimet? Kun katsot suoraan ristikäsien keskellä, paina avaruuspalkki.",
    fr: "Prêt à identifier les lettres? Tout en regardant directement le centre des poils, veuillez appuyer sur la barre d'espace.",
    gd: "Deiseil gus na litrichean aithneachadh? Fhad 's a tha thu a' coimhead gu dìreach ri meadhan na croise, thoir air preas air a 'bhàr-fànais.",
    ka: "მზად ხართ ასოების იდენტიფიცირებისთვის? ჯვრის თმების ცენტრში პირდაპირ დათვალიერებისას, გთხოვთ, დააჭირეთ კოსმოსურ ზოლს.",
    de: "Bereit, die Buchstaben zu identifizieren? Während Sie direkt in die Mitte der Cross -Haare schauen, drücken Sie bitte die Raumleiste.",
    el: "Είστε έτοιμοι να προσδιορίσετε τα γράμματα; Ενώ κοιτάζετε απευθείας στο κέντρο των σταυροειδών τριχών, πατήστε το Space Bar.",
    gu: "અક્ષરો ઓળખવા માટે તૈયાર છો? સીધા ક્રોસ વાળની ​​મધ્યમાં જોતી વખતે, કૃપા કરીને સ્પેસ બાર દબાવો.",
    he: "מוכנים לזהות את האותיות? תוך כדי התבוננות ישירות במרכז שערות הצלב, אנא לחץ על מוט החלל.",
    hi: "पत्रों की पहचान करने के लिए तैयार हैं? क्रॉस हेयर के केंद्र में सीधे देखते हुए, कृपया स्पेस बार दबाएं।",
    hu: "Készen áll a betűk azonosítására? Miközben közvetlenül a keresztszőrzet közepére nézi, kérjük, nyomja meg az űrrúdot.",
